import React, {useState} from "react";
import { AiFillLike, AiFillDislike } from "react-icons/ai";

function Rating(props) {
  const [vote, setVote] = useState(props.rating);

  function handleClickUpVote() {
    setVote((previousVote) => previousVote + 1);
  }

  function handleClickDownVote() {
    setVote((previousVote) => previousVote - 1);
  }
  return (
    <div>
      <div className="rating">
        <div className="vote-emojis">
                <div
                  className="vote-button"
                  onClick={() => handleVote(video.id, "like")}
                >
                  <AiFillLike className="like-icon" />
                </div>
                <div
                  className="vote-button"
                  onClick={() => handleVote(video.id, "dislike")}
                >
                  <AiFillDislike className="dislike-icon" />
                </div>
          </div>
      </div>
    </div>
  );
}

export default Rating;
